import "./AdminPage.css";
import AdminProductList from "../../Components/AdminProductList/AdminProductList";
import AdminPageHeading from "../../Components/AdminPageHeading/AdminPageHeading";
import AdminPageAddProduct from "../../Components/AdminPageAddProduct/AdminPageAddProduct";
import {useState} from 'react'

const AdminPage = () => {

  const [isAddProductVisible, setAddProductVisible] = useState(false)
  console.log(isAddProductVisible)

  const toggleAddProductVisible = () => {
    setAddProductVisible(!isAddProductVisible)
    console.log(isAddProductVisible)
  }
  return (
    <div className="AdminPageWrapper">
      <AdminPageHeading toggleAddProductVisible={toggleAddProductVisible}/>
      {isAddProductVisible && <AdminPageAddProduct/>}
      <AdminProductList />
    </div>
  );
};

export default AdminPage;
